import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import MuiAccordion from '@material-ui/core/Accordion';
import MuiAccordionSummary from '@material-ui/core/AccordionSummary';
import MuiAccordionDetails from '@material-ui/core/AccordionDetails';
import Typography from '@material-ui/core/Typography';

import closegripbenchfoto from '../images/close-grip-bench-press.jpg'; 
import triceppushdownfoto from '../images/tricep-pushdown.jpg'; 

import data from '../data/data.json';

const Accordion = withStyles({
  root: {
    border: '1px solid rgba(0, 0, 0, .125)',
    boxShadow: 'none',
    '&:not(:last-child)': {
      borderBottom: 0,
    },
    '&:before': {
      display: 'none',
    },
    '&$expanded': {
      margin: 'auto',
    },
  },
  expanded: {},
})(MuiAccordion);

const AccordionSummary = withStyles({
  root: {
    backgroundColor: 'rgba(0, 0, 0, .03)',
    minHeight: 56,
    '&$expanded': {
      minHeight: 56,
    },
  },
  content: {
    '&$expanded': {
      margin: '12px 0',
    },
  },
  expanded: {},
})(MuiAccordionSummary);

const AccordionDetails = withStyles((theme) => ({
  root: {
    padding: theme.spacing(2),
  },
}))(MuiAccordionDetails);

export default function NewListChest() {
  const [expanded, setExpanded] = React.useState('');

  const handleChange = (panel) => (event, newExpanded) => {
    setExpanded(newExpanded ? panel : false);
  };

  const newData = data.map( (data) => {
    return (
        <div>
          <div>
            <Accordion square className="exerciseBlock" expanded={expanded === data.id} onChange={handleChange(data.id)} style={{border: 'none'}}>
                <AccordionSummary aria-controls="panel1d-content" id="panel1d-header" style={{paddingLeft: '25px'}}>
                <Typography>{data.exercisename}</Typography>
                </AccordionSummary>
                <AccordionDetails style={{marginBottom: '50px'}}>
                    <Typography>
                    {data.people.map((people) => {
                      return (
                        <div>
                          <b>{people.name}</b> drukt <br></br>{people.weight}
                        </div>
                      )
                    })}
                    </Typography>
                </AccordionDetails>
            </Accordion>
          </div>            
        </div>

    )
  })

  return (
    <div>
        <Typography variant="h6" style={{color: 'white'}}>
            Chest exercises
        </Typography><br></br>

        {newData}

        <br></br>
        <br></br>
        <br></br>
    </div>
  );
}
